Private Film 25 (Apocalypse Climax 1 / Nic Cramer, Private / Classic / 1995)

Deep inside enemy territory, the mysterious Colonel Flurtz (Melissa Hill) and her fanatic renegade troops run amok sexually. They are scoring victory after victory! This action packed journey lettered with luscious KGB spies, Viet Cong nymphs and insatiable allies. It's all there just for you!

Melissa Hill, Tammi Ann, Anita Blond (as Anita Kelly), Laura Palmer, Stefania Sartori (as Stephania), Agnes Tilli (as Agnes Titti), Eva Dionisio (as Eva Fever), Linda Moore (as Linda Moor), Karen Flach, Eva Falk (as Ewa Witt), Jon Dough, Kyle Stone, Yves Baillat, Frank Gun (as Ferenz Juhaz), Alberto Rey (as Alberto Ray), Frank Towers, Johnny B. Butt, Brent Beckett

Feature, Action, European, Historical, Anal

